import React from 'react'
import { Card, Image } from 'react-bootstrap'
import Col from 'react-bootstrap/Col'

const UserItem = ({user}) => {
    return (
        <Col md={3}>
            <Card style={{width: 150, cursor: 'pointer'}} border={"light"}>
                <Image width={150} height={150}/>
            </Card>
        </Col>
    )
}

export default UserItem
